import React, { Component } from 'react';
import { withRouter } from 'react-router';
import logo from './CookYLogo.png'
import {BrowserRouter as Router, Route, Switch, Link} from 'react-router-dom'
import './CookYStories.css'

class CookYStories extends Component {
    render() {
        return (
                <Router>
                <>
                    <HeaderComponent/>
                </>
                </Router> 
        );
    }
}

class HeaderComponent extends Component {
    render() {
        return (
            <header>
                <nav className="navbar navbar-expand-md navbar-dark bg-header">
                    <div>
                        <a className="navbar-brand" href="#">
                            <img src={logo}/>
                        </a>
                    </div>
                    <ul className="navbar-nav">
                        <li>CookYStories</li>
                    </ul>
                    <ul className="navbar-nav navbar-collapse justify-content-end">
                        {/* TODO if else for login / logout */}
                        <li>Login</li> 
                        <li>Logout</li>
                    </ul>
                </nav>
            </header>
        );
    }
}

export default CookYStories;
